"10:71" : {s: 10, a: 71, e: "Tell them the story of Noah. He said to his people, &lsquo;My people, if my presence among you and my reminding you of God&rsquo;s signs is too much for you, then I put my trust in God. Agree on your course of action, you and your partner-gods- do not be hesitant or secretive about it- then carry out your decision on me and give me no respite.", b: "আর তাদেরকে শুনিয়ে দাও নূহের অবস্থা যখন সে স্বীয় সম্প্রদায়কে বলল, হে আমার সম্প্রদায়, যদি তোমাদের মাঝে আমার অবস্থিতি এবং আল্লাহর আয়াতসমূহের মাধ্যমে নসীহত করা ভারী বলে মনে হয়ে থাকে, তবে আমি আল্লাহর উপর ভরসা করছি। এখন তোমরা সবাই মিলে নিজেরদের কর্ম সাব্যস্ত কর এবং এতে তোমাদের শরীকদেরকে সমবেত করে নাও, যাতে তোমাদের মাঝে নিজেদের কাজের ব্যাপারে কোন সন্দেহ-সংশয় না থাকে। অতঃপর আমার সম্পর্কে যা কিছু করার করে ফেল এবং আমাকে অব্যাহতি দিও না।"},
"10:72" : {s: 10, a: 72, e: "But if you turn away, I have asked no reward from you; my reward is with God alone, and I am commanded to be one of those who devote themselves to Him.&rsquo;", b: "তারপরও যদি বিমুখতা অবলম্বন কর, তবে আমি তোমাদের কাছে কোন রকম বিনিময় কামনা করি না। আমার বিনিময় হল আল্লাহর দায়িত্বে। আর আমার প্রতি নির্দেশ রয়েছে যেন আমি আনুগত্য অবলম্বন করি।"},
"10:73" : {s: 10, a: 73, e: "But they rejected him. We saved him and those with him on the Ark and let them survive; and We drowned those who denied Our revelations- see what was the end of those who were forewarned!", b: "তারপরও এরা মিথ্যা প্রতিপন্ন করল। সুতরাং তাকে এবং তার সাথে নৌকায় যারা ছিল তাদের কে বাঁচিয়ে নিয়েছি এবং যথাস্থানে আবাদ করেছি। আর তাদেরকে ডুবিয়ে দিয়েছি যারা আমার কথাকে মিথ্যা প্রতিপন্ন করেছে। সুতরাং লক্ষ্য কর, কেমন পরিণতি ঘটেছে তাদের যাদেরকে ভীতি প্রদর্শন করা হয়েছিল।"},
"10:74" : {s: 10, a: 74, e: "Then, after him, We sent messengers to their peoples bringing them clear signs. But they would not believe in anything they had already rejected: in this way We seal the hearts of those who are full of hostility.", b: "অনন্তর আমি নূহের পরে বহু নবী-রসূল পাঠিয়েছি তাদের সম্প্রদায়ের প্রতি। তারপর তাদের কাছে তারা প্রকাশ্য দলীল-প্রমাণ উপস্থাপন করেছে, কিন্তু তাদের দ্বারা এমনটি হয়নি যে, ঈমান আনবে সে ব্যাপারে, যাকে তারা ইতিপূর্বে মিথ্যা প্রতিপন্ন করেছিল। এভাবেই আমি মোহর এঁটে দেই সীমালংঘনকারীদের অন্তরসমূহের উপর।"},
"10:75" : {s: 10, a: 75, e: "After them We sent Moses and Aaron with Our signs to Pharaoh and his leading supporters, but they acted arrogantly- they were wicked people.", b: "অতঃপর তাদের পেছনে পাঠিয়েছি আমি মূসা ও হারুনকে, ফেরাউন ও তার সর্দারের প্রতি স্বীয় নির্দেশাবলী সহকারে। অথচ তারা অহংকার করতে আরম্ভ করেছে।"},
"10:76" : {s: 10, a: 76, e: "When the truth came to them from Us, they said, &lsquo;This is blatant sorcery.&rsquo;", b: "বস্তুতঃ তারা ছিল গোনাহগার। তারপর আমার পক্ষ থেকে যখন তাদের কাছে সত্য বিষয় উপস্থিত হল, তখন বলতে লাগলো, এগুলো তো প্রকাশ্য যাদু।"},
"10:77" : {s: 10, a: 77, e: "Moses said, &lsquo;Is this what you say about the Truth when it comes to you? Is this sorcery? Sorcerers never prosper.&rsquo;", b: "মূসা বলল, সত্যের ব্যাপারে একথা বলছ, তা তোমাদের কাছে পৌঁছার পর? একি যাদু? অথচ যারা যাদুকর, তারা সফল হতে পারে না।"},
"10:78" : {s: 10, a: 78, e: "They said, &lsquo;Have you come to turn us away from the faith we found our fathers following, so that you and your brother can gain greatness in this land? We will never believe in you.&rsquo;", b: "তারা বলল, তুমি কি আমাদেরকে সে পথ থেকে ফিরিয়ে দিতে এসেছ যাতে আমরা পেয়েছি আমাদের বাপ-দাদাদেরকে? আর যাতে তোমরা দুইজন এদেশের সর্দারী পেয়ে যেতে পার? আমরা তোমাদেরকে কিছুতেই মানব না।"},
